Config.db_item [17001]  = {id=17001, name=[[TranscensionCard]], desc=[[Use it to change your class. 

1. The gears you are wearing will be transferred to that of the corresponding class with <color=#18c114>the same tier, quality and star level</color>, keeping the same <color=#18c114>enhancing, polishing, gem, forging and set attributes</color>. (Gears in the bag and warehouse won't be transferred) 
Mythical gears can be dismantled into gears and Starfall Gears of your <color=#18c114>current class</color>. 

2. Sets will also be transferred accordingly. They can be dismantled into set stones of your <color=#18c114>current class</color>. 

3. <color=#18c114>Active Skills</color> and <color=#18c114>Passive Skills</color> will be transferred accordingly, <color=#18c114>Talent Skills</color> will be reset with all Talent Points returned. 

Rules: 
1. Your marriage will end if you change your gender 
